import React from "react";

function PaperCardboard() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Paper & Cardboard</h1>
      <p>Recycle paper and cardboard by keeping them dry and clean.</p>
      <ul>
        <li>Flatten cardboard boxes</li>
        <li>Remove any plastic wrapping</li>
        <li>Place in curbside recycling if available</li>
      </ul>
    </div>
  );
}

export default PaperCardboard;
